import React from "react";
import { MDBCol, MDBContainer, MDBRow, MDBFooter } from "mdbreact";
import { Container, Row, Col } from "react-bootstrap";
const FooterPage = () => {
  return (
    <footer style={{ backgroundColor: "black" }}>
      <Container>
        <Row className="ml-5">
          <Col>
            <ul>
              <li>Abhay</li>
              <li>Abhay</li>
              <li>Abhay</li>
            </ul>
          </Col>
          <Col>
            <ul>
              <li>Abhay</li>
              <li>Abhay</li>
              <li>Abhay</li>
            </ul>
          </Col>
        </Row>
      </Container>
    </footer>
  );
};

export default FooterPage;
